import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';

function App() {
  const [list ,setList] = useState([]);
  fetch("/")
  .then((response)=>{
    return response.json();
  })
  .then((data)=>{
    setList(data)
  }, []);
  return (
    <div className="App">
      <h1>메인 페이지 입니다.</h1>
      <h2>{list}</h2>
    </div>
  );
}

export default App;
